import { split } from "lodash";
import * as Function from "../func";

function MyPage(){
    const userInfo = Function.Fetching("user");

    if(!userInfo) { return <div> Loading ... </div> }
    else {
        return (
            <div id="div-box">
                <h1>MY PAGE</h1><hr/>
                <div style={{textAlign: "left", border: "1px solid black"}}>
                    <b> User Code : </b><span> {userInfo.code} </span><br/>
                    <b> User Name : </b><span> {userInfo.username} </span><br/>
                    <b> PassWord : </b><span> {userInfo.password} </span><br/>
                    <b> ROLE : </b><span> {split(userInfo.authorities[0].authority)[0]} </span><br/>
                </div>
            </div>
        )
    }
}

export default MyPage
